import React from 'react';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      monster: [
        {
          name: 'Ace'
        },
        {
          name: 'Las'
        },
        {
          name: 'granny'
        }
      ]
    };
  }

  render() {
    return <div>{this.state.monster.map(monsterName => monsterName.name)}</div>;
  }
}

export default App;
